import React from 'react';

export const Video = () => {
  const constraints = {
    video: true,
    audio: true,
  };
  navigator.mediaDevices
    .getUserMedia(constraints)
    .then((stream) => {})
    .catch((error) => {
      console.error('Error accessing media devices.', error);
    });

  return (
    <video width="750" height="500" controls>
      <source src="./Videos/video1.mp4" type="video/mp4" />
    </video>
  );
};
